import React from 'react';
import { Routes, Route } from 'react-router-dom';
import LoginPage from './components/LoginPage';
import SignupPage from './components/SignupPage';
import Dashboard from './components/Dashboard';
import InventoryPage from './pages/InventoryPage';
import RequestPage from './pages/RequestPage';
import ApprovePage from './pages/ApprovePage';
import InventorySummaryPage from './pages/InventorySummaryPage';
import DirectorDashboard from './pages/director/DirectorDashboard';
import InventoryManagerDashboard from './pages/manager/InventoryManagerDashboard';
import FulfillRequestsPage from './pages/FulfillRequestsPage';
import StembassadorDashboard from './pages/stembassador/StembassadorDashboard';
import RequestItemsPage from './pages/stembassador/RequestItemsPage';
import AddUserPage from './pages/director/AddUserPage';
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  return (
    <Routes>
      {/* Public Routes */}
      <Route path="/" element={<LoginPage />} />
      <Route path="/signup" element={<SignupPage />} />

      {/* Dashboards with Role Protection */}
      <Route path="/dashboard" element={<Dashboard />} />
      <Route path="/dashboard/director" element={
        <ProtectedRoute role="director">
          <DirectorDashboard />
        </ProtectedRoute>
      } />
      <Route path="/dashboard/inventory" element={
        <ProtectedRoute role="inventory_manager">
          <InventoryManagerDashboard />
        </ProtectedRoute>
      } />
      <Route path="/dashboard/stembassador" element={
        <ProtectedRoute role="stembassador">
          <StembassadorDashboard />
        </ProtectedRoute>
      } />

      {/* STEMbassador routes */}
      <Route path="/stembassador/request" element={
        <ProtectedRoute role="stembassador">
          <RequestItemsPage />
        </ProtectedRoute>
      } />
      <Route path="/request-items" element={
        <ProtectedRoute role="stembassador">
          <RequestItemsPage />
        </ProtectedRoute>
      } />

      {/* Inventory Manager routes */}
      <Route path="/inventory" element={
        <ProtectedRoute role="inventory_manager">
          <InventoryPage />
        </ProtectedRoute>
      } />
      <Route path="/request" element={
        <ProtectedRoute role="inventory_manager">
          <FulfillRequestsPage />
        </ProtectedRoute>
      } />
      <Route path="/approve" element={
        <ProtectedRoute role="inventory_manager">
          <ApprovePage />
        </ProtectedRoute>
      } />

      {/* Director routes */}
      <Route path="/director/inventory" element={
        <ProtectedRoute role="director">
          <InventorySummaryPage />
        </ProtectedRoute>
      } />
      <Route path="/dashboard/director/add-user" element={
        <ProtectedRoute role="director">
          <AddUserPage />
        </ProtectedRoute>
      } />
    </Routes>
  );
}

export default App;
